- input: "TEXT\x1CC00412569\x1C.TEXT\x1C\x1CF3XA\x1CAll salary expense reported on
    line 21(b) is supposed to be reported on line 30(b). However, FEC software version
    6.2.1.0 does not allow this. AUDIT RESPONSE 1. Procedures to collect money: All
    advertising and invitations ask for name, address, phone #, e-mail address, occupation
    and employer name. However, some people just send a check. We follow up immediately
    with a thank you note. The note is accompanied with a written request for any
    missing information.  2. Two lawfirms have been corrected to show the owners instead.
    3. Four business names have been corrected to show the owner's names. None of
    the businesses were incorporated. 4. Republican Party of Texas is the state party,
    we are the county party. RPT has donated money to us to defray tickets to fund
    raisers for state party members and to reimburse for their advertising in our
    newsletter. We do not coordinate any expenditures with them. 5. Fund raising expenses
    of $15,548.33 were reallocated from line 21(a) to line 21(b).\n"
